<style>
    .login-container {
        width: 100%;
        max-width: 450px; /* Cân đối kích thước form */
        margin: 0 auto;
        margin-right: 100px;
        margin-left: -20px;
    }

    .card {
        box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
        border-radius: 10px;
    }

    .card-title {
        font-size: 2rem;
        margin-bottom: 1rem;
    }

    .btn-primary {
        background-color: #007bff;
        border-color: #007bff;
    }

        .btn-primary:hover {
            background-color: #0056b3;
            border-color: #004085;
        }

    .alert {
        margin-top: 1rem;
    }

    /* Ensure the form stays centered with or without the sidebar */
    #content {
        margin-left: 250px;
        transition: margin-left 0.3s ease;
        width: calc(100% - 250px);
    }

        #content.expanded {
            margin-left: 50px;
            width: calc(100% - 50px);
        }

    /* Center login form */
  ");
            WriteLiteral(@"  .login-content {
        display: flex;
        justify-content: center;
        align-items: center;
        min-height: 100vh;
        padding: 1rem;
    }
    /* Hover effect for input fields */
.form-control {
    transition: box-shadow 0.3s ease, transform 0.3s ease;
}

.form-control:focus {
    box-shadow: 0 0 8px rgba(0, 123, 255, 0.5);
    transform: scale(1.02); /* Phóng to nhẹ khi focus */
}

/* Button animation on hover */
.btn-primary {
    transition: background-color 0.3s ease, transform 0.3s ease;
}

.btn-primary:hover {
    background-color: #0056b3;
    transform: scale(1.05); /* Slightly enlarge button on hover */
}

/* Fade-in effect for card */
.card {
    opacity: 0;
    transform: translateY(-30px);
    animation: fadeIn 0.8s forwards; /* Smooth fade in */
}



/* Sidebar transition */
#sidebar {
    width: 250px;
    transition: width 0.3s ease;
}

#sidebar.collapsed {
    width: 50px;
    transition: width 0.3s ease;
}

</style>


